import React, { useState, useEffect } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Modal from 'react-bootstrap/Modal';

function CreateTask() {
  const [showModal, setShowModal] = useState(false);
  const [priority, setPriority] = useState('');
  const [participants, setParticipants] = useState([]); // State for participants
  const [selectedParticipants, setSelectedParticipants] = useState([]); // State for selected participants

  const handleCloseModal = () => setShowModal(false);
  const handleShowModal = () => setShowModal(true);

  const handlePriorityChange = (e) => {
    setPriority(e.target.value);
  };

  const handleParticipantChange = (e) => {
    const participantId = e.target.value;
    const isChecked = e.target.checked;

    if (isChecked) {
      setSelectedParticipants([...selectedParticipants, participantId]);
    } else {
      setSelectedParticipants(selectedParticipants.filter(id => id !== participantId));
    }
  };

  useEffect(() => {
    // Fetch participants from the backend
    fetch('http://localhost:5555/api/users') // Adjust the API endpoint as per your backend implementation
      .then(response => response.json())
      .then(data => setParticipants(data))
      .catch(error => console.error('Error fetching participants:', error));

    handleShowModal(); // Show modal when component mounts
  }, []);

  return (
    <>
      <Button variant="primary" onClick={handleShowModal}>
        Open Modal
      </Button>

      <Modal show={showModal} onHide={handleCloseModal}>
        <Modal.Header closeButton>
          <Modal.Title>Create Task</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            <fieldset>
              <Form.Group className="mb-3">
                <Form.Label htmlFor="taskName">Task Name</Form.Label>
                <Form.Control id="taskName" placeholder="Task Name" />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label htmlFor="dateDue">Date Due</Form.Label>
                <Form.Control id="dateDue" type="date" placeholder="Date Due" />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label htmlFor="priority">Priority</Form.Label>
                <Form.Select id="priority" onChange={handlePriorityChange} value={priority}>
                  <option value="">Select Priority</option>
                  <option value="High">High</option>
                  <option value="Medium">Medium</option>
                  <option value="Low">Low</option>
                </Form.Select>
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Participants</Form.Label>
                {participants.map(participant => (
                    <Form.Check
                    key={participant.id}
                    type="checkbox"
                    id={`participant-${participant.id}`}
                    label={`${participant.username} - ${participant.fullName}`}
                    value={participant.id}
                    checked={selectedParticipants.includes(participant.id)}
                    onChange={handleParticipantChange}
                    />
                ))}
                </Form.Group>

            </fieldset>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleCloseModal}>
            Close
          </Button>
          <Button variant="primary" onClick={handleCloseModal}>
            Save Changes
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default CreateTask;
